import d from "./aaaaaa.json";
let data = d;

export function ido() {
  data.forEach((e) => {
    let demo = e.changes;
    let a = [];
    console.log(demo);
    e.changes = [];
    for (let index = 0; index < demo.length; index++) {
      a.push(demo[index].changeName);
    }
    console.log(a);
    demo = [];
    e.changes = [...a];
    console.log(e.changes);
  });

  console.log(data);
}
